import { BrowserRouter as Router, Switch, Route} from "react-router-dom";
import './App.css';
import './NavBar';
import NavBar from "./NavBar";
import Home from "./Home"

function App() {
  return (
    //BEM
    <Router>
      <div className="app">
        <Switch>
          <Route path="/">
            <NavBar/>
            <Home/>
            </Route>
        </Switch>  
      </div>
    </Router>
  );
}


export default App;
